create table appointment
(
    id               BIGINT(19) auto_increment comment 'id'
        primary key,
    username         VARCHAR(255) null comment '姓名',
    phone            VARCHAR(50)  null comment '联系电话',
    jurisdiction     BIGINT(19)   null comment '辖区',
    appointment_date VARCHAR(50)  null comment '预约日期',
    appointment_time VARCHAR(50)  null comment '预约时间',
    address          VARCHAR(255) null comment '现居地',
    create_time      BIGINT(19)   null comment '创建时间',
    update_time      BIGINT(19)   null comment '修改时间',
    status           VARCHAR(10)  null comment '受理状态',
    ma_open_id       VARCHAR(255) null comment '小程序open id'
)
    collate = utf8_bin;

